import React, {Component} from "react"
// const p = x => console.log(p)

export default class Goal extends Component {
  constructor(props) {
    super(props)
  }




  render() {
    const sessionLength= this.props.sessionslength

    return (
      <div>
        <h2>Table</h2>

          <table>

          {
            this.props.sessions.map(session => {
              return (
                <colgroup span={sessionLength}></colgroup>
              )
            })
          }
        <tr>
            <td rowspan="2"></td>

            {
              this.props.sessions.map((session, i) => {
                return (
                  <th colspan={this.props.sessions.length} scope="colgroup">{session}</th>
                )
              })
            }

        </tr>

        <tr>
          {

            this.props.sessions.map(session => {
              return (

                this.props.steps.map((step, i) => {
                  return (
                    <th scope="col">{step}</th>
                  )
                })

              )
            })





          }


          <th scope="col">C</th>
          <th scope="col">L</th>
          <th scope="col">H</th>
          <th scope="col">S</th>

          <th scope="col">C</th>
          <th scope="col">L</th>
          <th scope="col">H</th>
          <th scope="col">S</th>

          <th scope="col">C</th>
          <th scope="col">L</th>
          <th scope="col">H</th>
          <th scope="col">S</th>
        </tr>
        <tr>
          <th scope="row">Week 1</th>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
        </tr>
        <tr>
          <th scope="row">Week 2</th>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
          <td></td>
        </tr>
    </table>



      </div>

    )
  }
}
